import{_ as r}from"./plugin-vue_export-helper-c27b6911.js";import{r as i,o as n,c,b as e,d as t,f as a,a as d}from"./app-cc74cb39.js";const s="/assets/2024-04-02-22-34-42-af560216.png",l={},h=d('<h1 id="git-学习笔记" tabindex="-1"><a class="header-anchor" href="#git-学习笔记" aria-hidden="true">#</a> Git 学习笔记</h1><figure><img src="'+s+'" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><h2 id="写在前面" tabindex="-1"><a class="header-anchor" href="#写在前面" aria-hidden="true">#</a> 写在前面</h2><p>在写这篇 Git 学习笔记的时候，实际上我已经使用了很久的 Git 了，但是对于 Git 我并没有系统性的学习过，仅仅只看过网上的一些基础用法便开始了实际的项目管理。</p><p>使用的主要功能主要为：<code>add</code>、<code>commit</code>、<code>push</code>、<code>clone</code> 这几个，对于分支管理、PR等功能在自己的项目中并没有使用过，属于是一个分支写到底，也并没有对开源项目做一些贡献，没有实际的技术需求，基本的提交、拉取功能基本能满足我的项目需求。</p><p>但是步入职场，对于 Git 的使用要求更加严格，必须掌握常用的一些 Git 命令的使用，不仅仅局限于推送拉取等，还要深刻的学习分支管理等一些知识点，故此本章诞生。</p><h2 id="参考资料" tabindex="-1"><a class="header-anchor" href="#参考资料" aria-hidden="true">#</a> 参考资料</h2>',7),p={href:"https://www.liaoxuefeng.com/wiki/896043488029600",target:"_blank",rel:"noopener noreferrer"},_={href:"https://www.runoob.com/git/git-tutorial.html",target:"_blank",rel:"noopener noreferrer"};function f(u,m){const o=i("ExternalLinkIcon");return n(),c("div",null,[h,e("ul",null,[e("li",null,[t("廖雪峰【推荐】："),e("a",p,[t("https://www.liaoxuefeng.com/wiki/896043488029600"),a(o)])]),e("li",null,[t("菜鸟教程："),e("a",_,[t("https://www.runoob.com/git/git-tutorial.html"),a(o)])])])])}const x=r(l,[["render",f],["__file","index.html.vue"]]);export{x as default};
